import React from 'react';
import './style.css';
import 'bootstrap/dist/css/bootstrap.css'


class LandingPage extends React.Component{

    
    render(){

        return (<div>
            <h1 className="hey">Hello World</h1>
            <p>This is the landing page</p>
            </div>
        )
    }
}

export default LandingPage;
